import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { SafeAreaProvider } from 'react-native-safe-area-context';

import useCachedResources from './hooks/useCachedResources';
import useColorScheme from './hooks/useColorScheme';
import Navigation from './navigation';
import Canvas from './screens/canvas';

const categoryArray = [
  {id: '1' ,name: 'Table', category: 'Furniture',image:'https://homepages.cae.wisc.edu/~ece533/images/airplane.png'},
  {id: '2' ,name: 'Chair', category: 'Furniture',image:'https://homepages.cae.wisc.edu/~ece533/images/boat.png'},
  {id: '3' ,name: 'Door', category: 'Furniture',image:'https://homepages.cae.wisc.edu/~ece533/images/cat.png'},

  {id: '4' ,name: 'TV', category: 'Electronics',image:'https://homepages.cae.wisc.edu/~ece533/images/airplane.png'},
  {id: '5' ,name: 'Camera', category: 'Electronics',image:'https://homepages.cae.wisc.edu/~ece533/images/boat.png'},
  {id: '6' ,name: 'Mobile', category: 'Electronics',image:'https://homepages.cae.wisc.edu/~ece533/images/cat.png'}]

export default function App() {
  const isLoadingComplete = useCachedResources();
  const colorScheme = useColorScheme();

  if (!isLoadingComplete) {
    return null;
  } else {
    return (
      <Canvas location = "Left" name = "Menu" arrayCategory = {categoryArray} showCategories = {true} showTitle = {true} searchIsEnabled = {true} disableDragAndDrop={false} />

      // <SafeAreaProvider>
      //   <Navigation colorScheme={colorScheme} />
      //   <StatusBar />
      // </SafeAreaProvider>
    );
  }
}
